import React from 'react';
import Video from '../../videos/video.mp4';
import {HeroContainer,
HeroBG,
VideoBg} from './HeroElements';

const HeroSection = () => {
    return (
        <HeroContainer>
            <HeroBG>
                <VideoBg autoPlay loop muted src={Video} type='video/mp4'/>
            </HeroBG>
        </HeroContainer>
    )
}

export default HeroSection
